import React from 'react';
import { Link, Outlet } from 'react-router-dom';

const Blog = () => {
    const posts = [
        { id: 1, title: 'Learning React' },
        { id: 2, title: 'Understanding Nested Routes' },
        { id: 3, title: 'React Router Basics' },
    ];

    return (
        <div className="p-6">
            <h1 className="text-3xl font-bold mb-4">Blog</h1>
            <div className="space-y-4">
                {posts.map((post) => (
                    <div key={post.id} className="bg-gray-100 p-4 rounded shadow-md">
                        <Link to={`${post.id}`} className="text-xl text-blue-500 hover:underline">
                            {post.title}
                        </Link>
                    </div>
                ))}
            </div>
            <hr className="mt-6" />
            {/* Render the nested route */}
            <Outlet />
        </div>
    );
};

export default Blog;
